import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { MapPinIcon, ArrowRightIcon, ClockIcon } from '@heroicons/react/24/outline';
import { Card, Button, Loading } from '../components/common';
import { toast } from 'react-toastify';

const HomePage = () => {
  const [location, setLocation] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [nearbyParkings, setNearbyParkings] = useState([]);
  const [loadingParkings, setLoadingParkings] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    // Get user's current location
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;
          setLocation({ lat: latitude, lng: longitude });
          setIsLoading(false);
          fetchNearbyParkings(latitude, longitude);
        },
        (error) => {
          console.error("Error getting location:", error);
          toast.error("Unable to get your location. Please enable location services.");
          setIsLoading(false);
          // Use default location (Mumbai)
          const defaultLocation = { lat: 19.1266816, lng: 72.8662016 };
          setLocation(defaultLocation);
          fetchNearbyParkings(defaultLocation.lat, defaultLocation.lng);
        }
      );
    } else {
      toast.error("Geolocation is not supported by your browser");
      setIsLoading(false);
    }
  }, []);

  // Fetch nearby parking locations (mock data for now)
  const fetchNearbyParkings = (lat, lng) => {
    setLoadingParkings(true);
    
    // In a real app, this would be an API call
    // For now, we'll use mock data
    setTimeout(() => {
      const mockParkings = [
        {
          id: 'p1',
          name: 'Nakshatra Mall',
          address: '385, N C Kelkar Marg, Dadar West, Mumbai, Maharashtra 400028',
          distance: '0.5 km',
          availableSpots: 15,
          totalSpots: 69,
          hours: 'MON - SUN',
          operatingTime: '06:00 AM - 11:00 PM',
          rate: '₹40/hr',
          lat: lat + 0.002,
          lng: lng + 0.001
        },
        {
          id: 'p2',
          name: 'Metro Station Parking',
          address: '2nd Floor, Metro Complex, Mumbai',
          distance: '1.2 km',
          availableSpots: 18,
          totalSpots: 70,
          hours: 'MON - SAT',
          operatingTime: '05:00 AM - 11:30 PM',
          rate: '₹30/hr',
          lat: lat - 0.001,
          lng: lng + 0.003
        },
        {
          id: 'p3',
          name: 'Downtown Secure Parking',
          address: 'Downtown Plaza, Main Road, Mumbai',
          distance: '2.3 km',
          availableSpots: 32,
          totalSpots: 80,
          hours: 'MON - SUN',
          operatingTime: '24 hours',
          rate: '₹25/hr',
          lat: lat + 0.004,
          lng: lng - 0.002
        },
        {
          id: 'p4',
          name: 'Hospital Parking Zone',
          address: 'Near City Hospital, Health Avenue, Mumbai',
          distance: '3.0 km',
          availableSpots: 15,
          totalSpots: 40,
          hours: 'MON - SUN',
          operatingTime: '24 hours',
          rate: '₹20/hr',
          lat: lat - 0.003,
          lng: lng - 0.001
        }
      ];
      
      setNearbyParkings(mockParkings);
      setLoadingParkings(false);
    }, 1500);
  };

  const handleSelectParking = (parkingId) => {
    navigate(`/parking/${parkingId}`);
  };

  const refreshLocation = () => {
    setIsLoading(true);
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;
          setLocation({ lat: latitude, lng: longitude });
          setIsLoading(false);
          fetchNearbyParkings(latitude, longitude);
        },
        (error) => {
          console.error("Error getting location:", error);
          toast.error("Unable to get your location. Please enable location services.");
          setIsLoading(false);
        }
      );
    }
  };

  if (isLoading) {
    return (
      <div className="flex flex-col items-center justify-center h-[70vh]">
        <Loading size="lg" />
        <p className="mt-4 text-neutral-600 dark:text-neutral-400">Getting your location...</p>
      </div>
    );
  }

  return (
    <div className="max-w-4xl mx-auto">
      <div className="bg-yellow-400 rounded-lg p-6 mb-6">
        <h1 className="text-2xl font-bold mb-2 text-center">ParkASpot</h1>
      </div>

      {/* Nearby parking list */}
      <div className="mb-8">
        {loadingParkings ? (
          <div className="flex justify-center py-8">
            <Loading />
          </div>
        ) : nearbyParkings.length > 0 ? (
          <div className="space-y-4">
            {nearbyParkings.map((parking) => (
              <Card
                key={parking.id}
                hover={true}
                className="cursor-pointer overflow-hidden border-none shadow-md"
                onClick={() => handleSelectParking(parking.id)}
              >
                <div className="border-l-4 border-yellow-400 pl-4">
                  <div className="flex flex-col">
                    <div className="flex items-start mb-2">
                      <MapPinIcon className="h-5 w-5 text-yellow-500 flex-shrink-0 mt-0.5 mr-2" />
                      <div>
                        <h3 className="font-semibold text-lg">{parking.name}</h3>
                        <p className="text-neutral-600 dark:text-neutral-400 text-sm">{parking.address}</p>
                      </div>
                    </div>

                    <div className="flex items-start mb-2">
                      <ClockIcon className="h-5 w-5 text-yellow-500 flex-shrink-0 mt-0.5 mr-2" />
                      <div>
                        <p className="text-neutral-600 dark:text-neutral-400 text-sm">{parking.hours}</p>
                        <p className="text-neutral-600 dark:text-neutral-400 text-sm">{parking.operatingTime}</p>
                      </div>
                    </div>

                    <div className="bg-yellow-100 p-2 rounded-md mt-2">
                      <p className="font-medium text-center">Parking Availability: [{parking.availableSpots}/{parking.totalSpots}]</p>
                    </div>

                    <div className="grid grid-cols-10 gap-1 mt-4">
                      {/* First row of sample parking slots */}
                      {Array.from({ length: 10 }, (_, i) => {
                        const isAvailable = Math.random() > 0.5;
                        return (
                          <div 
                            key={`slot-row1-${i}`} 
                            className={`flex items-center justify-center p-1 rounded-sm ${isAvailable ? 'bg-white border border-gray-300' : 'bg-black text-white'}`}
                          >
                            <span className="text-xs">{i}</span>
                          </div>
                        );
                      })}
                      
                      {/* Second row */}
                      {Array.from({ length: 10 }, (_, i) => {
                        const isAvailable = Math.random() > 0.5;
                        return (
                          <div 
                            key={`slot-row2-${i}`} 
                            className={`flex items-center justify-center p-1 rounded-sm ${isAvailable ? 'bg-white border border-gray-300' : 'bg-black text-white'}`}
                          >
                            <span className="text-xs">{i+10}</span>
                          </div>
                        );
                      })}
                    </div>
                  </div>
                </div>
              </Card>
            ))}
          </div>
        ) : (
          <div className="text-center py-8 bg-neutral-50 dark:bg-neutral-800/50 rounded-lg">
            <p className="text-neutral-600 dark:text-neutral-400">No parking spots found nearby.</p>
            <Button 
              variant="primary" 
              className="mt-4" 
              onClick={refreshLocation}
            >
              Try Again
            </Button>
          </div>
        )}
      </div>

      {/* Mobile navigation dots */}
      <div className="flex justify-center space-x-2 mt-8">
        <div className="w-2 h-2 rounded-full bg-yellow-400"></div>
        <div className="w-2 h-2 rounded-full bg-gray-300"></div>
        <div className="w-2 h-2 rounded-full bg-gray-300"></div>
      </div>
    </div>
  );
};

export default HomePage;
